import styled from 'styled-components';

export const Form = styled.form`
    background-color: #eee;
    display: flex;
    align-items: center;
    border: none;
    border-radius: 15px;
    justify-content: space-between;
    padding-left: 15px;
`;

export const TextInput = styled.input`
    background-color: pink;
    display: flex;
    align-items: center;
    border: none;
    border-radius: 15px;
    margin: 0;
    width: 500px;
`;

export const ButtonInput = styled.input`
    background-color: pink;
    display: flex;
    align-items: center;
    border: none;
    border-radius: 15px;
    margin: 0;
`;

export const TextContainer = styled.div`
    display: flex;
    align-items: center;
    gap: 10px;
`;
